import React, { Component } from 'react';
import { pickTheme } from '../redux/actions'
import { pinkTheme, lavenderTheme, oliveTheme } from '../theming/themes'
import { connect } from 'react-redux';
import { ThemeProvider } from 'styled-components/native';
import Settings from './Settings'
import { Container, HeaderContainer, HeaderText, Line, Button,
  ButtonText, ProfileText, ProfileImage, ProfileContainer, Content, 
  PeopleImage, MatchesContainer, MatchesText } from '../theming/dashStyle'


class Dashboard extends Component {
  render() {
      console.log(this.props.theme)
    return (
        <ThemeProvider theme={ this.props.theme }>

            <Container>
                <HeaderContainer>
                    <HeaderText>mobile app</HeaderText>
                </HeaderContainer>
                <Line></Line>


                <ProfileContainer>
                    <ProfileImage source={require('../rashi.jpeg')} />
                    <ProfileText>
                        your name {"\n"}
                        your major {"\n"}
                        your year
                    </ProfileText>
                </ProfileContainer>

                <MatchesContainer>
                  <MatchesText>your top matches</MatchesText>
                  <PeopleImage source={require('../rashi.jpeg')} />
                  <PeopleImage source={require('../rashi.jpeg')} />
                  <PeopleImage source={require('../rashi.jpeg')} />
                </MatchesContainer>

            </Container>
        </ThemeProvider>
    );
  }
}

function mapStateToProps(state) {
    return {
        theme: state.themeReducer.theme
    }
}

export default connect(mapStateToProps, {pickTheme})(Dashboard);
